@media only screen and (min-width: 600px) {

.accordion {
    border: 1px solid rgba(0, 0, 0, 0.1);

}

.accordion__item + .accordion__item {
    border-top: 1px solid rgba(0, 0, 0, 0.1);

.accordion__button {

    color: #444;
    cursor: pointer;
    padding: 10px;
    width: 100%;
    text-align: left;
    border: none;
}

.accordion__button:hover {
    background-color: #ddd;
}

.accordion__button:before {
    display: inline-block;
    content: '';
    height: 10px;
    width: 10px;
    margin-right: 12px;
    border-bottom: 2px solid currentColor;
    border-right: 2px solid currentColor;
    transform: rotate(-45deg);
}

.accordion__button[aria-expanded='true']::before,
.accordion__button[aria-selected='true']::before {
    transform: rotate(45deg);
}

.accordion__panel {
    padding: 20px;
    animation: fadein 0.35s ease-in;

the product already added\n    Then The product should be deleted\n  \n  Scenario: Review and modification cart\n    When I place the mouse on the product to add and i click on Add to Cart button\n    And I choose the size, the color and the quantity\n    And I click on Add to Cart\n    And I click on the cart icon\n    And I click on View and Edit Cart button\n    And I click on Edit item parametres icon\n    And I modify the quantity of the product\n    And I click on Updat cart button\n    Then cart should be modified\n","mediaType":"text/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"file:///C:/Users/WajdiABDELHAFIDH/eclipse-workspace/Luma_Project/src/specs/features/Cart.feature","feature":{"location":{"line":2,"column":1},"tags":[{"location":{"line":1,"column":1},"name":"@cart","id":"82b7d42c-7b0c-40b6-b194-4ef343d46e8f"}],"language":"en","keyword":"Feature","name":"Verify that the add to cart functionality works correctly for all products.","description":"  As a customer,\n  I want to ensure that I can add any product to my shopping cart,\n  So that I can easily buy several items at once.","children":[{"background":{"location":{"line":7,"column":3},"keyword":"Background","steps":[{"location":{"line":8,"column":5},"keyword":"Given ","text":"I am on the Accueil page","id":"a7ec8bed-8591-4183-9722-2c23bf970b0c"},{"location":{"line":9,"column":5},"keyword":"And ","text":"I click on Shop Yoga Now link","id":"0a559152-77ea-41c4-8808-e70382411a00"}],"id":"8eb4fac5-ecb1-48d8-a113-e0e10797f77f"}},{"scenario":{"location":{"line":11,"column":3},"keyword":"Scenario","name":"Add a single product to the cart","steps":[{"location":{"line":12,"column":5},"keyword":"When ","text":"I place the mouse on the product to add and i click on Add to Cart button","id":"c96c4dbe-9e72-4855-b117-6f7310295426"},{"location":{"line":13,"column":5},"keyword":"And ","text":"I choose the size, the color and the quantity","id":"e5a69a1e-b432-4efc-a69a-b724291f7b50"},{"location":{"line":1 \n    And I click on Proceed to Cheackout button\n    And fill all fields with valid information\n    And select Fixed shipping methods and click next button\n    And I click on Place Order button\n    Then the order should be placed successfully\n\n  Scenario: Failed checkout, no shipping method selected\n    Given I am on the Accueil page\n    And I click on Shop Yoga Now link\n    When I place the mouse on the product to add and i click on Add to Cart button\n    And I choose the size, the color and the quantity\n    And I click on Add to Cart\n    And I click on the cart icon\n    And I click on Proceed to Cheackout button\n    And fill all fields with valid information\n    And Click next button\n    Then An error message should be displayed\n\n  Scenario: Failed Checkout,empty informations\n    Given I am on the Accueil page\n    And I click on Shop Yoga Now link\n    When I place the mouse on the product to add and i click on Add to Cart button\n    And I choose the size, the color and the quantity\n    And I click on Add to Cart\n    And I click on the cart icon\n    And I click on Proceed to Cheackout button\n    And I leave all the chomps empty\n    And select Fixed shipping methods and click next button\n    Then the order should be failed\n\n  Scenario: Successful Checkout after being loged\n    Given I am on the Accueil page\n    When I click on Sign In link\n    And I enter my valid email \"abdelhafidhwajdi@gmail.com\" and password \"Wajdi.17\"\n    And I click the Sign In button\n    And I click on Shop Yoga Now link\n    And I place the mouse on the product to add and i click on Add to Cart button\n    And I choose the size, the color and the quantity\n    And I click on Add to Cart\n    And I click on the cart icon\n    And I click on Proceed to Cheackout button\n    And select Fixed shipping methods and click next button\n    And I click on Place Order button\n    Then the order should be placed successfully\n\n  Scenario: Checkout after closing the browser and re-launch it\n    Given I am on the Accueil page\n    And I click on Shop Yoga Now link\n    When I place the mouse on the product to add and i click on Add to Cart button\n    And I choose the size, the color and the quantity\n    And I click on Add to Cart\n    And I click on the cart icon\n    And I click on Proceed to Cheackout button\n    And fill all fields with valid information\n    And select Tabel Rate shipping methods and click next button\n    And close browser and relaunch it\n    And I click on Place Order button\n    Then the order should be placed successfully\n\n  Scenario: Add a Review\n    Given I am on the Accueil page\n    And I click on Shop Yoga Now link\n    And I click on a product\n    And I click on Add Your Review button\n    And I fill a Nickname \"Lewis\" summary \"Great\" and review \"satisfied\"\n    And I select Rating and i click on Submit Review button\n    Then The Review should be added\n\n","mediaType":"text/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"file:///C:/Users/WajdiABDELHAFIDH/eclipse-workspace/Luma_Project/src/specs/features/Checkout.feature","feature":{"location":{"line":2,"column":1},"tags":[{"location":{"line":1,"column":1},"name":"@checkout","id":"7b4ed699-3e47-49dd-ac93-f9bf6f0896ce"}],"language":"en","keyword":"Feature","name":"Verify Checkout functionality","description":"  As a customer,\n  I want to be able to checkout and complete my purchase,\n  So that I can receive the products I have ordered","children":[{"scenario":{"location":{"line":7,"column":3},"keyword":"Scenario","name":"Successful Checkout,Tabel Rate Shipping Methods","steps":[{"location":{"line":8,"column":5},"keyword":"Given ","text":"I am on the Accueil page","id":"928700da-95cd-4d93-9936-6d044c95a976"},{"location":{"line":9,"column":5},"keyword":"And ","text":"I click on Shop Yoga Now link","id":"05632bde-f530-4301-8ae3-4fde0310e67d"},{"location":{"line":10,"column":5},"keyword":"When ","text":"I place the mouse on the b0baa1a"}],"astNodeIds":["f664d124-6c4a-4208-b8b5-02fedec56abc"]}},{"source":{"uri":"file:///C:/Users/WajdiABDELHAFIDH/eclipse-workspace/Luma_Project/src/specs/features/Sorting.feature","data":"@sorting\nFeature: Verify that the sorting options for products are working correctly\n  As a user, \n  I want to verify that the sorting options for products are working correctly,\n  so that I can find the products that I am looking for in an efficient and accurate manner\n\n  Background: \n    Given I am on the Accueil page\n\n  Scenario: Sorting with price range\n    When I click on women link\n    And I click on Hoodies and SweatShirts button\n    And I click on Price dropdown menu and select the price range\n    Then The result of the search must respect the price range\n\n  Scenario: Sorting with Size\n    When I click on Men link\n    And I click on Men Jackets button\n    And I click on Size dropdown menu and select the Size\n    Then The result of the search must respect the Size\n\n  Scenario: Sorting with Color\n    When I click on women link\n    And I click on Bras and Tanks button\n    And I click on Color dropdown menu and select the Color\n    Then The result of the search must respect the Color selected\n\n  Scenario: Sorting by price organization,least expensive to the most expensive\n    When I click on Gear link\n    And I click on Bags button\n    And I select the price option from the dropdown menu\n    Then The search result must be displayed from the least expensive to the most expensive\n\n  Scenario: Sorting by Product Name organization\n    When I click on Gear link\n    And I click on Bags button\n    And I select product name from the dropdown menu\n    Then the result should be displayed in alphabetical order\n\n  Scenario: Sorting by price organization,most expensive to least expensive\n    When I click on Gear link\n    And I click on Bags button\n    And I select the price option from the dropdown menu\n    And I click on Sort By arrow\n    Then The search result must be displayed from most expensive to least expensive\n\n  Scenario: Sorting by product name reverse organization\n    When I click on Gear link\n    And I click on Bags button\n    And I select product name from the dropdown menu\n    And I click on Sort By arrow\n    Then the result should be displayed in reverse alphabetical order\n\n  Scenario: Change the display from Grid to List\n    When I click on Gear link\n    And I click on Bags button\n    And I click on List button\n    Then Products should be displayed in list form\n    \n    \n    \n    \n    \n    \n    \n    \n    \n    \n    \n","mediaType":"text/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"file:///C:/Users/WajdiABDELHAFIDH/eclipse-workspace/Luma_Project/src/specs/features/Sorting.feature","feature":{"location":{"line":2,"column":1},"tags":[{"location":{"line":1,"column":1},"name":"@sorting","id":"3c7c9f97-2e32-4b9e-b0f1-147646b08f85"}],"language":"en","keyword":"Feature","name":"Verify that the sorting options for products are working correctly","description":"  As a user, \n  I want to verify that the sorting options for products are working correctly,\n  so that I can find the products that I am looking for in an efficient and accurate manner","children":[{"background":{"location":{"line":7,"column":3},"keyword":"Background","steps":[{"location":{"line":8,"column":5},"keyword":"Given ","text":"I am on the Accueil page","id":"c680eb5d-bafb-447f-a676-7599a73d9795"}],"id":"30e4f426-e6a6-47df-aea2-e9df3fdf6c7b"}},{"scenario":{"location":{"line":10,"column":3},"keyword":"Scenario","name":"Sorting with price range","steps":[{"location":{"line":11,"column":5},"keyword":"When ","text":"I click on women link","id":"81317158-dcd2-45c8-a0f1-300b27102728"},{"location":{"line":12,"column":5},"keyword":"And ","text":"I click on Hoodies and SweatShirts button","id":"49d9c6e4-0085-4fc3-a879-b14031c9cc2d"},{"location":{"line":13,"column":5},"keyword":"And ","text":"I click on P
